content.css:
/* Container */
.controls-root {
  position: relative;
  width: 100%;
  height: 100%;
  background-color: #000;
  font-family: Arial, sans-serif;
}
/* Filters row */
.three-level-root {
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  padding: 16px;
  display: flex;
  align-items: center;
  background: #1c1c1c;
  border-bottom: 1px solid #333;
}
/* Dropdowns */
.three-level-dropdown {
  margin: 0 8px;
  padding: 8px 10px;
  font-size: 14px;
  border: 1px solid #444;
  border-radius: 4px;
  background-color: #2a2a2a;
  color: #fff;
  cursor: pointer;
  font-weight: bold;
  width: 100%;
  color: #000;
  background-color: #fff;
}
/* Search row */
.search-root {
  position: absolute;
  top: 56px;
  left: 0;
  right: 0;
  padding: 8px 24px;
}
.three-level-search {
  width: 100%;
  padding: 8px 16px;
  font-size: 14px;
  color: #fff;
  background-color: #2a2a2a;
  border: 1px solid #444;
  border-radius: 4px;
  margin-top: 10px;
  max-width: -webkit-fill-available;
  border: 1px solid lightgrey;
  background-color: black;
}
.summary-container::-webkit-scrollbar {
  display: none;
}
.three-level-search::placeholder {
  color: #fff;
}
/* Clear Filter Button */
.clear-filter-btn {
  background-color: #007bff;
  color: white;
  font-weight: bold;
  font-size: 14px;
  padding: 8px 16px;
  margin-top: 16px;
  border: none;
  border-radius: 4px;
  cursor: pointer;
  transition: background-color 0.2s ease;
}
.clear-filter-btn:hover {
  background-color: #0056b3;
}
/* Summary container */
.summary-container {
  position: absolute;
  top: 96px;
  left: 0;
  right: 0;
  margin: 24px;
  overflow-y: auto;
  max-height: calc(100% - 96px);
}
/* Level-1 group */
.summary-group {
  margin-bottom: 12px;
  background: #333;
  border-radius: 3px;
  color: #fff;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.3);
}
/* Level-1 item */
.summary-item {
  display: flex;
  justify-content: space-between;
  align-items: center;
  position: relative;
}
/* Level-1 bar */
.summary-bar-container {
  width: 100%;
  height: 4px;
  background: #444;
  border-radius: 2px;
  overflow: hidden;
  position: absolute;
  left: 0;
  bottom: 0;
}
.summary-bar-fill {
  height: 100%;
  background: #00e676;
  width: 0;
  transition: width 0.3s ease;
}
.summary-value {
  font-size: 16px;
  font-weight: bold;
}
/* Expand arrows */
.expand-arrow {
  font-size: 18px;
  margin-left: 8px;
  margin-right: 8px;
  cursor: pointer;
  color: #fff;
}
/* Sub-container (Level-2) */
/* Level-2 item (no bar) */
.summary-subitem {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 8px;
  color: #fff;
}
/* Level-3 container */
/* Level-3 row */
.summary-thirditem {
  display: flex;
  justify-content: space-between;
  color: #bbb;
  padding: 8px 16px;
  font-size: 14px;
}
/* Common styling */
.summary-left {
  display: flex;
  flex-direction: column;
  flex: 1;
}
.summary-label-row {
  display: flex;
  align-items: center;
  padding: 16px;
}
.lvl3summary-left {
  display: flex;
  flex-direction: row;
  align-items: center;
}
.summary-icon {
  width: 20px;
  height: 20px;
  margin-right: 8px;
}
.summary-label {
  font-size: 14px;
  color: #fff;
}
.third-label {
  font-size: 14px;
}
.summary-value,
.third-value {
  font-size: 16px;
  font-weight: bold;
}
.third-value {
  color: #bbb;
}
/* Hover Effects */
.summary-item:hover,
.summary-subitem:hover {
  background-color: #555;
}
